import { Outlet, Link } from "react-router-dom";
import logo from './Res/logo.png';

export default function App() {
  return (
    <body>
      <header>

        <div className="logo">
          <img src={logo} />
        </div>

        <ul className="menu">
          <li> <p>Home</p> </li>
          <li><Link to="/upload">Upload CSV</Link></li>

        </ul>

        <div class="hero">
          <div class="hero__content">
            <p class="intro-text">Sicurezza first</p>
            <h1 class="big-text">Login warrior</h1>
          </div>
        </div>

      </header>
    </body>
  );

}
